    // }    
    return(
        <div className="registrationDiv">
            <p>Registration</p>
            <span>Create account</span>
            <div className="forms">
                <input id="login"     type="text"     placeholder="Login" />
                <input id="password"  type="password" placeholder="Password" />
                <input id="password2" type="password" placeholder="Reset password" />
            </div> 
            <p id="errortext">Error</p>
            <button id="but" onClick={event => console.log( event.target.id)}>Create</button>
        </div>  
    )
}
